import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-manage-faq',
  templateUrl: './manage-faq.page.html',
  styleUrls: ['./manage-faq.page.scss'],
})
export class ManageFAQPage implements OnInit {

  constructor() { }

  ngOnInit() {
  }

}
<ion-header [translucent]="true">
  <ion-toolbar >
    <ion-buttons slot="start">
      <ion-button  class="custom-button" expand="block"><ion-icon name="chevron-back-outline" slot="start"></ion-icon></ion-button>
    </ion-buttons>
    <ion-title>Medical FAQs</ion-title>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true" class="gradient-background">
  <ion-header>
    <ion-toolbar class="header-background">
      <ion-title></ion-title>
    </ion-toolbar>
  </ion-header>

  <div id="container">
    <strong class="capitalize">Patient Assessment</strong>

  </div>


 </ion-content>
